/**
 * Componente: TablaAmortizacion
 * 
 * Muestra la tabla de amortizaci贸n mes a mes.
 * Componente puramente presentacional.
 */

import React from 'react';
import { formatCurrency } from '../utils/formatters';

export const TablaAmortizacion = ({ tabla, visible }) => {
  if (!visible || !tabla || tabla.length === 0) {
    return null;
  }

  const styles = {
    card: {
      backgroundColor: 'white',
      borderRadius: '12px',
      padding: '32px',
      boxShadow: '0 2px 8px rgba(0,0,0,0.1)',
      marginTop: '24px',
    },
    cardTitle: {
      fontSize: '1.5rem',
      marginBottom: '24px',
      color: '#2c3e50',
      borderBottom: '2px solid #3498db',
      paddingBottom: '12px',
    },
    tableContainer: {
      overflowX: 'auto',
      borderRadius: '8px',
      border: '1px solid #e0e0e0',
    },
    table: {
      width: '100%',
      borderCollapse: 'collapse',
      fontSize: '14px',
    },
    th: {
      backgroundColor: '#3498db',
      color: 'white',
      padding: '12px',
      textAlign: 'left',
      fontWeight: 'bold',
      position: 'sticky',
      top: 0,
    },
    td: {
      padding: '12px',
      borderBottom: '1px solid #e0e0e0',
    },
    trEven: {
      backgroundColor: '#f8f9fa',
    },
    trHover: {
      backgroundColor: '#e9ecef',
    },
  };

  return (
    <div style={styles.card}>
      <h3 style={styles.cardTitle}> Tabla de Amortizaci贸n</h3>

      <div style={styles.tableContainer}>
        <table style={styles.table}>
          <thead>
            <tr>
              <th style={styles.th}>Mes</th>
              <th style={{...styles.th, textAlign: 'right'}}>Cuota</th>
              <th style={{...styles.th, textAlign: 'right'}}>Inter茅s</th>
              <th style={{...styles.th, textAlign: 'right'}}>Amortizaci贸n</th>
              <th style={{...styles.th, textAlign: 'right'}}>Saldo</th>
            </tr>
          </thead>
          <tbody>
            {tabla.map((fila, index) => (
              <tr 
                key={fila.mes} 
                style={index % 2 === 0 ? styles.trEven : {}}
                onMouseEnter={(e) => e.currentTarget.style.backgroundColor = '#e9ecef'}
                onMouseLeave={(e) => e.currentTarget.style.backgroundColor = index % 2 === 0 ? '#f8f9fa' : 'white'}
              >
                <td style={styles.td}>{fila.mes}</td>
                <td style={{...styles.td, textAlign: 'right', fontWeight: 'bold'}}>
                  {formatCurrency(fila.cuota)}
                </td>
                <td style={{...styles.td, textAlign: 'right', color: '#dc3545'}}>
                  {formatCurrency(fila.interes)}
                </td>
                <td style={{...styles.td, textAlign: 'right', color: '#28a745'}}>
                  {formatCurrency(fila.amortizacion)}
                </td>
                <td style={{...styles.td, textAlign: 'right'}}>
                  {formatCurrency(fila.saldo)}
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>

      {/* Resumen */}
      <div style={{marginTop: '16px', padding: '16px', backgroundColor: '#f8f9fa', borderRadius: '8px'}}>
        <p style={{margin: 0, fontSize: '13px', color: '#6c757d'}}>
          <strong>Total de cuotas:</strong> {tabla.length} | 
          <strong style={{marginLeft: '12px'}}>Monto total:</strong> {formatCurrency(tabla.reduce((sum, f) => sum + f.cuota, 0))} | 
          <strong style={{marginLeft: '12px'}}>Intereses totales:</strong> {formatCurrency(tabla.reduce((sum, f) => sum + f.interes, 0))}
        </p>
      </div>
    </div>
  );
};
